import React from 'react';
import styled from 'styled-components';
import Paragraf from './Paragraf.js';
import TitleH2 from './TitleH2.js';
import Member1 from '../img/member1.jpg';
import Member2 from '../img/member2.jpg';
import SubTitle from './SubTitle.js';
import './MembersSay.css';


const Container = styled.div`
    width: 1900px;
    height: 881px;
    padding: 60px 0 80px;
    position: relative;
    text-align: center;

`

const Box = styled.div`
    width: 1200px;
    height: bopx;
    text-align: center;
    padding: 0 10px;
    margin: 0 351px;
    letter-spacing: 0.01px;
    line-height: 3em;
    ;
`


const Content = styled.div`
    width: 1000px;
    height: 240px;

    padding: 0 10px;
    margin: 115px 0 52px;
    display: flex;
    justify-content: space-around;
    letter-spacing: 0.01px;
    line-height: 3em;
    ;
    p{
        text-align: left;
        width: 493px;
    }
`


const Image = styled.div`
img{
    width: 240px;
    height:240px;
    top: 80px;
    left: 300px;

}
`

const Image1 = styled.div`
    img{
        width: 240px;
        height:240px;
        top: 80px;
        left: 300px;
    }
`
const PS = styled.p`
    width: 493px;
    text-align: left;

`
const Text = styled.div`
    width: 493px;
    display: flex;
    flex-direction: column;
    h3{
        text-align: left;
    }
`
class MembersSay extends React.Component{
    render(){
        return(
            <Container className="back" >
                <Box className="circle">
                    <TitleH2 text="Coding is for everyone, and so are we"/>
                    <Content>
                        <Text>
                            <Paragraf text="College is expensive. So are bootcamps. Not everyone can afford to quit their job to learn full-time. We’re here to make coding more flexible and accessible so everyone has a chance to learn."/>
                            <SubTitle text="Patrick Stapleton"/>
                            <PS>Co-Founder of Y Combinator-backed Tipe.io</PS>
                        </Text>
                        <Image className="member1"><img src={Member1} alt=""/></Image>
                    </Content>
                    <Content>
                    <Image1 className="member2"><img src={Member2} alt=""/></Image1>
                        <Text>
                            <Paragraf text="College is expensive. So are bootcamps. Not everyone can afford to quit their job to learn full-time. We’re here to make coding more flexible and accessible so everyone has a chance to learn."/>
                            <SubTitle text="Jackson Handry"/>
                            <PS>Founder of Webside.io</PS>
                        </Text>

                    </Content>
                    </Box>

            </Container>
        );
    }

}

export default MembersSay;
